import * as React from "react";
import about from './About'
import logo from "../Images/CSVValED.png";
import aboutImg from "../Images/exclamationPoint.svg";
import helpImg from "../Images/exclamationPoint.svg";
import './Heading.css';
import { Link } from "react-router-dom";

class Heading extends React.Component {
    render() {
        return (
            <h1 class="text-left" >
                <span className="badge bgWarning" id="help" role="button">
                    <Link to={about} >
                        <img src={aboutImg} />
                    </Link>
                </span>

                <a href="/">
                    <img src={logo} alt="CSVValEd" />
                </a>

                <span className="badge bg-primary" id="about" data-bs-toggle="modal" data-bs-target="#modalAbout" role="button">
                    <img src={help} />
                </span>
            </h1>
        );
    }
}

export default Heading;
